std::string Req2Descriptor::getFieldValueAsString(void *object, int field, int i) const
{
    omnetpp::cClassDescriptor *basedesc = getBaseClassDescriptor();
    if (basedesc) {
        if (field < basedesc->getFieldCount())
            return basedesc->getFieldValueAsString(object,field,i);
        field -= basedesc->getFieldCount();
    }
    Req2 *pp = (Req2 *)object; (void)pp;
    switch (field) {
        case FIELD_id_h: return ulong2string(pp->getId_h());
        case FIELD_msg_req: {std::stringstream out; out << pp->getMsg_req(); return out.str();}
        case FIELD_Ses: return ulong2string(pp->getSes());
        case FIELD_MSSb: {std::stringstream out; out << pp->getMSSb(); return out.str();}
        default: return "";
    }
}

bool Req2Descriptor::setFieldValueAsString(void *object, int field, int i, const char *value) const
{
    omnetpp::cClassDescriptor *basedesc = getBaseClassDescriptor();
    if (basedesc) {
        if (field < basedesc->getFieldCount())
            return basedesc->setFieldValueAsString(object,field,i,value);
        field -= basedesc->getFieldCount();
    }
    Req2 *pp = (Req2 *)object; (void)pp;
    switch (field) {
        case FIELD_id_h: pp->setId_h(string2ulong(value)); return true;
        case FIELD_Ses: pp->setSes(string2ulong(value)); return true;
        default: return false;
    }
}

